import React from 'react';
// import { Link } from 'react-router-dom';
import '../style/CommunityPage.css';
import banner_com from "../images/community/banner_com.png";
import recipe_tag from "../images/community/recipe.png";
import ill from "../images/community/ill.png";
import gluten from "../images/community/gluten.png";
import gluten_eat from "../images/community/gluten_eat.png";
import soy_post1 from "../images/community/soy.png";

function CommunityPage() {
    return (
        <section className='post_main'>
            <figure className='banner_com'>
                <img src={banner_com} alt="" />
            </figure>
            <h1>推薦話題</h1>
            <div className='filter_tag'>
                <div className='recipe'>
                    <img className='soy_post1' src={soy_post1} alt="" />
                    <img className='recipe_tag' src={recipe_tag} alt="" />
                </div>
                <div className='ill'><img src={ill} alt="" /></div>
                <div className='gluten'><img src={gluten} alt="" /></div>
                <div className='gluten_eat'><img src={gluten_eat} alt="" /></div>

            </div>




        </section>




        );
    }
export default CommunityPage;
